import React, { useEffect, useState } from 'react'

interface WeekViewProps {
  week: Array<number>
}

export const WeekView = (props: WeekViewProps) => {
  const { week } = props

  console.log(week)

  return (
    week &&
    week.map(day => {
      return <>{day}</>
    })
  )
}
